import { Link } from "react-router-dom";

function Layout() {
    return (
        <div className='Header'>
            <h2 className='Titel'>Co2Ampel</h2>
            <Link to="/">Home</Link>
            <Link to="/Evaluation">Home</Link>
            <Link to="/Options">Home</Link>
        </div>
    )
}
export default Layout;
